Pix and Video - Mira - Office Life

Released : July 8, 2011

A good secretary is invaluable. She can help the boss on so many ways, making office life easy and often much more pleasurable. Mira is one of these gifted secretaries, and David highly values her presence in the office, rewarding her work with some premium. Sometimes it is money, sometimes it is a gift, and other time, like now, it is a good pussy pumping.
